import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { HttpGetHelper } from "../helpers";

// components

import Navbar from "components/Navbars/AuthNavbar.js";
import Footer from "components/Footers/Footer.js";
import Diagnosa from "components/Diagnosis";

export default function Diagnosis() {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetch = async () => {
      const httpResponse = await HttpGetHelper.getData(
        "https://covid19.mathdro.id/api/countries/ID/confirmed",
        {}
      );
      if (httpResponse) {
        setData(httpResponse);
      }
    };

    fetch();
  }, []);

  return (
    <>
      <Navbar class="bg-blueGray-800" />
      <main>
        <section className="relative py-32">
          <div className="container mx-auto px-4">
            <div className="items-center flex flex-wrap">
              <div className="w-full md:w-6/12 ml-auto mr-auto p-4">
                <div>
                  <h3 className="text-3xl font-semibold">Sesi Diagnosis</h3>
                  <p className="mt-4 text-lg leading-relaxed text-blueGray-500">
                    Dalam sesi diagnosis ini, kamu akan diberikan beberapa
                    pertanyaan seputar kesehatan yang harus dijawab sesuai
                    dengan kondisi sebenarnya kesehatan kamu. Sistem akan
                    melakukan kalkulasi dari total keseluruhan jawaban untuk
                    menentukan apakah kamu menunjukkan gejala covid-19 atau
                    tidak.
                  </p>
                  <div className="mt-16 mb-5">
                    <button className="w-8/12 text-xs font-bold bg-lightBlue-400 active:bg-lightBlue-100 uppercase text-white px-4 py-2 rounded shadow hover:shadow-md outline-none focus:outline-none lg:mr-1 lg:mb-0 mb-3 ease-linear transition-all duration-150">
                      Mulai
                    </button>
                  </div>
                </div>
              </div>
              <div className="w-full md:w-4/12 ml-auto mr-auto px-4">
                <img
                  alt="..."
                  className="max-w-full rounded-lg shadow-lg"
                  src="https://images.pexels.com/photos/4167541/pexels-photo-4167541.jpeg?cs=srgb&dl=pexels-anna-shvets-4167541.jpg&fm=jpg"
                />
              </div>
            </div>
          </div>
        </section>
      </main>
      <Footer />
    </>
  );
}
